ALTER SESSION SET NLS_DATE_FORMAT='DD/MM/YYYY';
SET LINESIZE 120
SET PAGESIZE 100

CREATE TABLE LodgeAllocation(
   lodge_id            VARCHAR(5)  NOT NULL,
   allocation_date     DATE        NOT NULL,
   allocation_time     VARCHAR(5)  NOT NULL,
   pet_id              VARCHAR(7)  NOT NULL,
   reason              VARCHAR(19) NOT NULL,
   event               VARCHAR(9)  NOT NULL CHECK(UPPER(event) in ('CHECK-IN', 'CHECK-OUT')),
   primary key(lodge_id, allocation_date, allocation_time),
   CONSTRAINT fk_lodge_allocation_lodge FOREIGN KEY(lodge_id) REFERENCES Lodge(lodge_id),
   CONSTRAINT fk_lodge_allocation_pet FOREIGN KEY(pet_id) REFERENCES Pet(pet_id)
);


select count(*) as TotalLodgeAllocationRecords from LodgeAllocation;
